import { Injectable } from '@angular/core';
import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { Alignment } from 'pdfmake/interfaces';
(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

import { catchError } from "rxjs/internal/operators";
import { HttpClient, HttpHeaders, HttpErrorResponse } from "@angular/common/http";
import { map } from 'rxjs/operators';
import { BehaviorSubject, Observable, throwError } from 'rxjs';

import { Physician, Prescription,  User, Medicine, Symptom, endpoint } from 'src/app/shared/classes';

@Injectable({
  providedIn: 'root'
})
export class PrescriptionService {

  prescriptions: Prescription[];

  private  userObject = new BehaviorSubject<User>(new User());
   
  selectedUser = this.userObject.asObservable();

    //PDFMake properties that require typecast from javascript
    pageMargins: [number,number,number, number] = [50, 50, 50, 50];
    right: Alignment = "right";
  
    //QR code will refer to URL of Patient Profile 
    qrURL:string = "http://localhost:8089/patient/";

    private extractData(res: Response): any{
      const body = res;
      return body || {};
    }
  
    constructor(private http: HttpClient) { }
    

    changeUser(user: User) {
      this.userObject.next(user);
    }

    getPrescriptionsByUser(uId: number): Observable<any>{
      return this.http.get(endpoint + 'prescriptions/user/'+ uId ).pipe
        (map(this.extractData),
        catchError(this.handleError)); 
    }
    
    getPrescription(pId: string ): Observable<any>{
      return this.http.get(endpoint + 'prescriptions/' + pId).pipe
        (map(this.extractData),
        catchError(this.handleError)); 
    } 

    AddPrescription(p: Prescription, aId: number): Observable<any>{
      return this.http.post(endpoint + 'prescriptions/appointment/' + aId, p).pipe
      (map(this.extractData),
      (catchError(this.handleError))); 
    }

    AddSymptomToPrescription(pId : string, symptoms: number[]): Observable<any>{
      return this.http.put<Prescription>(endpoint + 'prescriptions/'+ pId+ '/symptoms/', symptoms).pipe
      (catchError(this.handleError))
    }

  
    private handleError(error : HttpErrorResponse): any {
      if(error.error instanceof ErrorEvent){
        console.error('An error occurred', error.error.message)
      }
      else{
        console.error(
          'Backend returned code: '+error.status +
          'body was: '+ error.error
        );
      }
      return throwError(
        ('Something bad happened; please try again later!')
      )
    }
  

  generatePdf(prescription: Prescription){
    const documentDefinition = this.getDocDefinition(prescription);
    pdfMake.createPdf(documentDefinition).open();
   }

   getDocDefinition(prescription: Prescription){
    sessionStorage.setItem('prescription', JSON.stringify(prescription));
     return {
       background : {
         image : 'bg',
         width: 600,
         height: 850 
       },
       pageMargins: this.pageMargins,    
       content: [
        
       
         { 
           columns :[
             [
              {
                text: "ID:  "  + prescription.prescription_id,
                style: 'name'
          },
          {
            text: 'By:  ' + prescription.physician.physician_name,
            color: 'blue'
          },
          {
                text:  prescription.physician.physician_spec,
          },
          {
                text: 'Patient:  ' + prescription.user.userac_name,
                color: 'green'
          },
          {
                text: 'Date of Birth:  ' + prescription.user.userac_dob
          },
          {
                text: 'Mobile:  ' + prescription.user.userac_mobile          
              
          }
        ]

     ] ,
     alignment: this.right      
  },
  {
    text: 'Rx',
  style: 'title'          },
           
          {
            text: 'Symptoms Observed',
            style: 'header'
          },
          {
            columns : [
              {
                ul : [
                  ...prescription.symptom.filter((text, index) => index % 3 === 0).map(s => s.symptom_text)
                ]
              },
              {
                ul : [
                  ...prescription.symptom.filter((text, index) => index % 3 === 1).map(s => s.symptom_text)
                ]
              },
              {
                ul : [
                  ...prescription.symptom.filter((text, index) => index % 3 === 2).map(s => s.symptom_text)
                ]
              }
            ]
          },
          {
            text: 'Diagnosis',
            style: 'header'
          },
          {
            text: prescription.prescription_diagnosis
          },
          {
            text: 'Notes',
            style: 'header'
          },
          {
            text: prescription.prescription_notes
          },
          {
            text: 'Medicines',
            style: 'header'
          },          
            this.getMedicineObject(prescription.medicine),
            {
              qr: this.qrURL
            }      
          
            ],
        styles: {
          title: {
            fontSize: 28,
            bold: true,
            
          },
          header: {
            fontSize: 14,
            color: "#e8b200",
            bold: true
          }
        },
        images: {
          bg: 'data:image/png;base64,'
        }    
}
}
   getMedicineObject(medicines: Medicine[]){
    return {
      table: {
				headerRows: 1,
        widths: ['*', '*', '*', '*'],
        body: [
          [{
            text: 'Brand',
            style: 'tableHeader'
          },
          {
            text: 'Composition',
            style: 'tableHeader'
          },
          {
            text: 'Dosage',
            style: 'tableHeader'
          },
          {
            text: 'Frequency',
            style: 'tableHeader'
          }
          ]
          ,
          ...medicines.map(md => {
            return [md.medicine_brand, md.medicine_composition, md.medicine_dosage, md.medicine_frequency];
          })
        ]
      },
			layout: 'lightHorizontalLines'
    };
   }

}
